import React from "react";

function HomePage() {
  return (
    <div>
      <h1>Bienvenue sur l'application e-commerce</h1>
      <p>Ajoutez vos produits et profitez du shopping en ligne !</p>
      <button onClick={() => alert("Boutique bientôt disponible !")}>
        Voir les produits
      </button>
    </div>
  );
}
